// 是记忆化搜索啊，那我为什么会t呢
// 我靠，居然就是单纯的太慢了
// 我靠，不传引用是真的不行，传引用才能ac，不传的话，就太慢了
int getmint(vector<vector<int>> &relation, vector<int> &time, vector<int> &mint, int n)
{
    if (mint[n] == -1)
    {
        int t = 0;
        for (int rel : relation[n])
            t = max(t, getmint(relation, time, mint, rel));
        mint[n] = t + time[n - 1];
    }
    return mint[n];
}

int minimumTime(int n, vector<vector<int>> &relations, vector<int> &time)
{
    vector<vector<int>> tree(n + 1, vector<int>(0, 0));
    for (int i = 0; i < relations.size(); i++)
    {
        int father = relations[i][0];
        int son = relations[i][1];
        tree[son].push_back(father);
    }
    int mint = 0;
    vector<int> dp(n + 1, -1);
    for (int i = 1; i <= n; i++)
    {
        mint = max(mint, getmint(tree, time, dp, i));
    }
    return mint;
}
